import ReactPlayer from "react-player";

const VideoPlayer = () => {
    return (
        <div className="video-player">
            <div className="Front-Panel">
                <h1>Video Player</h1>
                <ReactPlayer controls url="https://www.youtube.com/watch?v=C6SEwTyJtpE&t=1s" />
            </div>
            
        </div>
    );
}
 
export default VideoPlayer;
